using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using Core.Components;
using UnityEngine;

namespace States
{
    public interface IState
    {
        public string StateId { get; }

        public void OnEnter();
        public void OnExit();

        public void OnProcess();
    }

    public readonly struct StateTransition
    {
        public IStateTransitionCondition Condition => _transitionCondition;
        
        public readonly IState fromState;
        public readonly IState toState;
        private readonly IStateTransitionCondition _transitionCondition;
        
        public StateTransition(IState fromState, IState toState, IStateTransitionCondition transitionCondition)
        {
            this.fromState = fromState;
            this.toState = toState;
            _transitionCondition = transitionCondition;
        }

        public void OnEnter()
        {
            _transitionCondition.OnEnter();
        }

        public bool TryTransit(out IState transitState)
        {
            transitState = null;

            if (!PredicateResult())
                return false;
            
            transitState = toState;
            
            return true;
        }

        private bool PredicateResult()
        {
            return _transitionCondition.Verify();
        }

        public bool IsCompareToFromState(int stateID)
        {
            var fromStateId = fromState.GetHashCode();
            return fromStateId.Equals(stateID);
        }
    }

    public class StateMachine : BaseComponent, IDisposable
    {
        private IState _currentState;
        private Dictionary<int, LinkedList<StateTransition>> _filteredTransitions;

        private readonly StateTransition[] _transitions;
        private readonly StringBuilder _stringBuilder = new();

        public StateMachine(params StateTransition[] transitions)
        {
            var firstState = transitions.First().FromState;
            _transitions = transitions;
            
            InitStates();
            SetState(firstState);
        }

        private void InitStates()
        {
            _filteredTransitions = new Dictionary<int, LinkedList<StateTransition>>();
            
            foreach (var currentTransition in _transitions)
            {
                var fromState = currentTransition.FromState;
                var fromStateID = fromState.GetHashCode();

                if (_filteredTransitions.ContainsKey(fromStateID)) continue;

                var filteredTransitions = new LinkedList<StateTransition>();

                foreach (var transition in _transitions)
                {
                    var fromStateTransitionId = transition.FromState.GetHashCode();

                    if (fromStateID.Equals(fromStateTransitionId))
                    {
                        filteredTransitions.AddLast(transition);
                    }
                }

                _filteredTransitions.Add(fromStateID, filteredTransitions);
            }
        }
        
        private void SetState(IState state)
        {
            var stateId = state.GetHashCode();
            
            _currentState?.OnExit();  
            _currentState = state;
            _currentState.OnEnter();
            
            var transitions = _filteredTransitions[stateId];

            foreach (var transition in transitions)
            {
                transition.OnEnter();
            }
        }

        public void Process()
        {
            if(!IsEnabled) return;

            if (_currentState == null)
            {
                Debug.LogWarning("State Machine - State is null. Returning...");
                return;
            }
            
            _currentState.OnProcess();
            var currentStateId = _currentState.GetHashCode();
            var transitions = _filteredTransitions[currentStateId];

            foreach (var transition in transitions)
            {
                if (!transition.TryTransit(out var state)) continue;
                if (!transition.IsCompareToFromState(currentStateId)) continue;
                    
                SetState(state);
                break;
            }
        }

        public void Dispose()
        {
            _stringBuilder.Clear();
        }
    }
}

