function toggle() {
    let buttonMoreElement = document.querySelector('.button');
    let extraTextElement = document.querySelector('#extra');

    let more = 'More';
    let less = 'Less';

    buttonMoreElement.textContent = buttonMoreElement.textContent === more ? less : more;
    
    extraTextElement.style.display = extraTextElement.style.display === 'none' || extraTextElement.style.display === '' ? 'block' : 'none';
}

